INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (101, 1, 0, 0.029, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 105, 0, 110, 122601, 1, 160, 1.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (102, 2, 1, 0.014, 3, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 111, 0, 105, 122401, 2, 120, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 3, 0, 0.017, 2, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 105, 1, 110, 122501, 3, 350, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (104, 4, 1, 0.016, 3, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 105, 0, 110, 107501, 4, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 5, 0, 0.014, 1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105, 0, 110, 107601, 5, 160, 2.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (106, 6, 0, 0.029, 2, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 103, 1, 120, 107801, 6, 255, 3.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (107, 7, 0, 0.013, 1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 103, 0, 120, 110601, 7, 160, 3.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (108, 8, 0, 0.014, 2, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 103, 1, 110, 110401, 8, 350, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (109, 9, 1, 0.012, 3, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 100, 0, 105, 110501, 9, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (110, 10, 0, 0.014, 1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 103, 0, 105, 115701, 10, 200, 2.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (111, 11, 0, 0.071, 2, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 103, 1, 105, 113601, 11, 350, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (112, 12, 1, 0.014, 3, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 103, 0, 120, 107901, 12, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (113, 13, 0, 0.022, 2, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 105, 0, 110, 108001, 13, 200, 1.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (114, 14, 0, 0.031, 1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 108, 0, 110, 110301, 14, 160, 2.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (115, 15, 1, 0.036, 1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 105, 0, 110, 107701, 15, 130, 0.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (116, 16, 0, 0.048, 2, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 95, 1, 110, 113101, 16, 350, 3.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (117, 17, 1, 0.043, 3, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 0, 105, 113301, 17, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (118, 18, 1, 0.018, 2, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 95, 0, 105, 113201, 18, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (119, 19, 0, 0.021, 2, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 108, 0, 110, 117001, 19, 160, 2.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (120, 20, 0, 0.036, 1, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 105, 1, 110, 113501, 20, 255, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (121, 21, 0, 0.02, 3, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 1, 105, 113401, 21, 350, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (122, 22, 1, 0.018, 1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 105, 0, 110, 110101, 22, 130, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (123, 23, 0, 0.03, 3, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 111, 0, 105, 110001, 23, 160, 3.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (124, 24, 1, 0.027, 1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 103, 0, 110, 117201, 24, 130, 1.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (125, 25, 0, 0.02, 2, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 108, 0, 105, 117301, 25, 160, 3.5, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (126, 26, 0, 0.04, 3, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 105, 1, 110, 117401, 26, 350, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (127, 27, 0, 0.009, 1, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 105, 1, 110, 117101, 27, 350, 3.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (128, 28, 0, 0.022, 1, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 105, 1, 120, 122901, 28, 255, 3.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (129, 29, 1, 0.028, 3, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 105, 0, 110, 122801, 29, 130, 2.5, 0);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (130, 30, 0, 0.023, 2, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 108, 0, 105, 122701, 30, 130, 3.5, 1);
